from collections import Counter

if __name__ == '__main__':
    #s = 'google'
    #s = 'aabbbccde'
    #s = 'szrmtbttyyaymadobvwniwmozojggfbtswdicoewnoqsjrkimhvimghixqryqgzhgbakpncwupcadwvglmupbexijimonxdowqsjinqzytkooacwkchatuwpsoxwvgrrejkukcvyzbkfnzfvrthmtfvmbppkdebswfpspxnelhqnjlgntqzsprmhcnuomrvuyolvzlni'
    s = ''
    if len(s) >= 3 and len(s) <= 10**4:
        countr = Counter(s).most_common()

        scount = sorted(countr, key=lambda k: (k[1], k[0]), reverse=True)

        numcount = sorted(Counter(dict(scount).values()).items(), reverse=True)

        final = []
        if numcount[0][1] >= 3:

            final = sorted(scount[:numcount[0][1]])[:3]
        elif numcount[0][1] == 1 and numcount[1][1] == 1 and numcount[2][1] == 1:

            final = sorted(scount[:3])
        else:
            if numcount[0][1] == 1:

                first = scount.pop(0)
                final = [first] + sorted(scount[:numcount[1][1]])[:2]
            else:

                final = sorted(scount[:numcount[0][1]])[:2] + sorted(scount[2: 2 + numcount[1][1]])[:1]
        for k,v in final:
            print('{} {}'.format(k, v))